import { useEffect, useState } from "react";
import { getSomethingFromMyAPI } from "../src";

function Index() {
  const [data, setData] = useState({});

  useEffect(() => {
    getSomethingFromMyAPI().then(response => setData(response));
  }, [setData]);

  return (
    <div>
      <h1>Alo BEBE, QUE TENES PARA MI</h1>
      <p>{data.greeting || "Loading..."}</p>
      <style jsx>
        {`
          p {
            color: red;
          }
        `}
      </style>
    </div>
  );
}

export default Index;
